import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import {Card } from 'react-bootstrap';

function Contacts() {
    return (
        <div >
            <h3>Contacts</h3>

            <Card bg='dark' text='light'>
                <Card.Header as="h6">Basic Skills</Card.Header>
                <Card.Body>
                    <Card.Text>
                    Full Name: Lwandiso Ntlanga{<br />}
                    Contact Number: 084 822 8176{<br />}
                    Email: lwandisontlanga@yahoo.com{<br />}
                    </Card.Text>
                    <Card.Link href="linkedin.com/in/lwandiso-ntlanga">LinkedIn</Card.Link>
                    <Card.Link href="https://github.com/Lwandiso-Ntlanga?tab=repositories">GitHub</Card.Link>
                </Card.Body>
            </Card>
            <ul>
                <li class="contacts"><strong>Full Name:</strong> Lwandiso Ntlanga </li>
                <li class="contacts"><strong>Contact Number:</strong> 0848228176</li>
                <li class="contacts"><strong>Email:</strong> lwandisontlanga@yahoo.com</li>
                <li class="contacts"><strong>LinkedIn:</strong><a href="linkedin.com/in/lwandiso-ntlanga" > Lwandiso Ntlanga</a></li>
                <li class="contacts"><strong>GitHub:</strong><a href="https://github.com/Lwandiso-Ntlanga?tab=repositories" > GitHub Repositories</a></li>
            </ul>
        </div>
    );
}

export default Contacts;
